import React, { Component } from 'react';
import './Die.css';

class Die extends Component {
    constructor(props) {
        super(props);

    }


    render() {
        return (
            <span className="die-Icon"> 
                <i class="fas fa-dice-six"></i>
            </span>
        )
    }
}

export default Die;
